 import {
  GoogleMapProvider,
  useGoogleMap,
 } from "@ubilabs/google-maps-react-hooks";
import { useState } from "react";

 const mapOptions = {
  zoom: 12,
  center: {
    lat: 50.7521, 
    lng: 2.7001
  },
};

 export default function MapOfGoogle() {

  const [mapContainer, setMapContainer] = useState(null);

  return(
    <div>
      <GoogleMapProvider
        googleMapsApiKey= "AIzaSyDpSrQ5Ey93gZgzhAWp0AlGAa351IUkUOI"
        options={mapOptions}
        mapContainer={mapContainer}
      >
        <div ref={node => setMapContainer(node)} style={{ height: "100vh" }}></div>
      </GoogleMapProvider>
      
    </div>
  )

 }


